import React, {Component} from 'react';
import { BrowserRouter as Router } from 'react-router-dom';
import './App.css';
import NavbarPage from './components/NavBarPage';
import Card from './components/Card';

class App extends Component{
  render(){
    return (
      <div className="App">
      <NavbarPage />
      <div className='homeRow'>
        <Card title="Dominos" cost="6.99" 
        desc="Pasta & Wings"/> 
        <Card title="Pizza Hut" cost="6.99"
        desc="Cheese sticks" />
        <Card title="Freebirds" desc="Chicken Bowl" cost="6.99"/>
        <Card title="Hana Kitchen" desc="Beef Plate" cost="6.99"/>
      </div>    
      </div>
    );
  }
}

export default App;
